import React from 'react';
import { Link } from "react-router-dom";
import './Nav.css';

const Nav = () => {
  return (
      <nav>
        <ul className="tab-row">
            <li>
                <Link to="/nat" className="tab" id="tab1">me</Link>
            </li>
            <li>
                <Link to="/projects" className="tab"id="tab2">projects</Link>
            </li>
            <li>
                <Link to="/music" id="tab3">music</Link>
            </li>
            <li>
                <Link to="/art" id="tab4">art</Link>
            </li>
        </ul>
      </nav>

  )
}

export default Nav;
